INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (21, 0, "vo_adv_1033501_002", "", "", "vo_adv_1033501", "", 0, 1033501045, "", 1033501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 6, "それにしても食べるのが\nもったいねぇいいケーキだなぁ……\nでも食べなきゃ食べねぇで\nもったいねぇよなぁ……", "", 0, 103311, 0, 1, 1033501046, 1, 1033501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (91, "", "", "", "", 0, "", "", 1033501047, "", 1033501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (21, 0, "vo_adv_1033501_003", "", "", "vo_adv_1033501", "", 0, 1033501048, "", 1033501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 6, "うーん……\nオラ一人で食べるのも申し訳ねぇし\nエリザベスパークのみんなで\n食べるべか！", "", 0, 103311, 0, 1, 1033501049, 1, 1033501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (91, "", "", "", "", 0, "", "", 1033501050, "", 1033501);
