INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 6, "みんなで過ごすのがオラにとって\n最高の誕生日だべ！\nあんがとな、あんちゃん！", "", 0, 103311, 0, 1, 1033501052, 1, 1033501);
