INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 4, "わあ……素敵なケーキね！\nえ？　キミが作ったの？\nすごいじゃない！", "", 0, 103411, 0, 1, 1034501040, 1, 1034501);
