INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 5, "しかし一時には\n赤子同然だった貴方が\nここまで成長したこと……\nとても喜ばしく思います。", "", 0, 107011, 0, 1, 1070501043, 1, 1070501);
INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (91, "", "", "", "", 0, "", "", 1070501044, "", 1070501);
