INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 4, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", "", 0, 111011, 0, 1, 1110501043, 1, 1110501);
