INSERT INTO `v1_06dd39e956412b832b08c509d8be6a31e3ed940cc149d7f883298b57b5727396` VALUES (11, 4, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", "", 0, 111011, 0, 1, 1110501046, 1, 1110501);
